//Make and object stick to the top on scroll
function sticky($id){

	$id = jQuery($id);

	if($id.length){
		var $item = $id.offset().top;
		jQuery(window).scroll(function() {
			if (jQuery(this).scrollTop() >= $item){
				$id.addClass("sticky");
			}
			else{
				$id.removeClass("sticky");
			}
		});
	}
}

